from collections import defaultdict

class Solution:
    def minJumps(self, arr: list[int]) -> int:
        if len(arr) < 2:
            return 0

        slotMap = defaultdict(list[int])
        for i in range(len(arr)):
            slotMap[arr[i]].append(i)
        
        visited = set[int]([len(arr)-1])
        stack = [len(arr)-1]
        tmp: list[int] = []
        depth: int = 0
        while stack:
            i = stack.pop()
            if i == 0:
                return depth

            for k in slotMap[arr[i]]:
                if k not in visited:
                    tmp.append(k)
                    visited.add(k)
            slotMap[arr[i]].clear() # clean used nodes
            
            if (k := i+1) < len(arr) and k not in visited:
                tmp.append(k)
                visited.add(i)
            if (k := i-1) not in visited:
                tmp.append(k)
                visited.add(i)
            
            if len(stack) == 0 and len(tmp) > 0:
                stack = tmp
                tmp = []
                depth += 1
        
        return -1

s = Solution()
print(s.minJumps([100,-23,-23,404,100,23,23,23,3,404]))
